import streamlit as st
import torch
from transformers import AutoTokenizer, AutoModel
import numpy as np
from sklearn.metrics.pairwise import cosine_similarity

# Load tokenizer and model
model_name = "bert-base-uncased"
tokenizer = AutoTokenizer.from_pretrained(model_name)
model = AutoModel.from_pretrained(model_name)

# Predefined FAQ database
faq_data = {
    "What is AI?": "Artificial Intelligence (AI) refers to the simulation of human intelligence in machines.",
    "How does machine learning work?": "Machine learning is a subset of AI that enables systems to learn from data and make decisions.",
    "What is tokenization?": "Tokenization is the process of breaking text into smaller units, such as words or subwords."
}

# Function to encode text into embeddings
def get_embedding(text):
    encoded = tokenizer(text, return_tensors="pt", truncation=True, padding=True)
    with torch.no_grad():
        output = model(**encoded)
    return output.last_hidden_state[:, 0, :].numpy()  # Extract CLS token embedding

# Convert FAQ questions into embeddings
faq_embeddings = {q: get_embedding(q) for q in faq_data.keys()}

# Streamlit UI
st.title("FAQ Assistant")
user_query = st.text_input("Ask a question:")

if user_query:
    query_embedding = get_embedding(user_query)

    # Compute similarity with FAQ embeddings
    similarities = {q: cosine_similarity(query_embedding, faq_embeddings[q])[0][0] for q in faq_data.keys()}
    best_match = max(similarities, key=similarities.get)

    st.write(f"**Answer:** {faq_data[best_match]}")

